How to implement aggregation query in Spring Data MongoDB?<p>I am new with Spring Data MongoDB and I am trying to implement an aggregation query in Java with Spring Data MongoDB. I have tried searching from this problem and approached it using <code>MongoTemplate</code>, but still to no result.</p>

<p>The format of my data:</p>

<pre><code>[{ 
    "_id" : ObjectId("5e1aea6c275360baf96bac29"), 
    "title" : "postim", 
    "upvotesBy" : [
        "5e18b4c12753608718dfa007", 
        "5e19ac0f5161a4994ded1f35"
    ], 
    "file" : "test", 
    "description" : "description", 
    "postedBy" : "5e18b4c12753608718dfa007", 
    "createdAt" : ISODate("2020-01-12T09:44:12.119+0000"), 
    "_class" : "com.socialnetwork.post.Post"
},
{ 
    "_id" : ObjectId("5e1aeaf8275360bb4bb47325"), 
    "title" : "postim2", 
    "upvotesBy" : [
        "5e18b4c12753608718dfa007", 
        "5e19ac0f5161a4994ded1f35"
    ], 
    "file" : "test2", 
    "description" : "description2", 
    "postedBy" : "5e18b4c12753608718dfa007", 
    "createdAt" : ISODate("2020-01-12T09:46:32.909+0000"), 
    "_class" : "com.socialnetwork.post.Post"
}]
</code></pre>

<p>My query:</p>

<pre><code>db.post.aggregate([
    {
      $match: {}
    },
    {
      $lookup: {
        from: "users",
        localField: "postedBy",
        foreignField: "_id",
        as: "user"
      }
    },
    {
      $group: {
        _id: {
          username: "$user.name",
          title: "$title",
          description: "$description",
          upvotes: { $size: "$upvotesBy" },
          upvotesBy: "$upvotesBy",
          isUpvoted: { $in: [req.query.userId, "$upvotesBy"] },
          isPinned: {
            $cond: {
              if: { $gte: [{ $size: "$upvotesBy" }, 3] },
              then: true,
              else: false
            }
          },
          file: "$file",
          createdAt: {
            $dateToString: {
              format: "%H:%M %d-%m-%Y",
              timezone: "+01",
              date: "$createdAt"
            }
          },
          id: "$_id"
        }
      }
    },
    { $sort: { "_id.isPinned": -1, "_id.createdAt": -1 } }
])
</code></pre>

<p>This is the query I use in my Javascript backend and I can do this fairly easy with Mongoose. However I am having some difficulty with the Java implementation of it.</p>

<pre><code>private LookupOperation getLookupOperation() {
        return LookupOperation.newLookup().from("user")
                .localField("postedBy")
                .foreignField("_id")
                .as("user");
    }

    @Override
    public List&lt;PostSummary&gt; aggregate() {
        LookupOperation lookupOperation = getLookupOperation();
        return mongoTemplate.aggregate(Aggregation.newAggregation(lookupOperation, Aggregation.group("id")
                .addToSet("user.name").as("username")
                .addToSet("title").as("title")
                .addToSet("description").as("description")
                .addToSet("id").as("id")
                .push("upvotesBy").as("upvotesBy")
                .addToSet("file").as("file")
                .addToSet("createdAt").as("createdAt")
        ), Post.class, PostSummary.class).getMappedResults();
}
</code></pre>

<p>When I try to run this I get the following error:</p>

<pre><code>"Cannot convert [] of type class java.util.ArrayList into an instance of class java.lang.Object! Implement a custom Converter&lt;class java.util.ArrayList, class java.lang.Object&gt; and register it with the CustomConversions. Parent object was: com.socialnetwork.post.PostSummary@7159d908"
</code></pre>

<p>When I delete the <code>.addToSet("user.name").as("username")</code> from the group aggregation I also get an error from <code>.push("upvotesBy").as("upvotesBy")</code> as it can not convert <code>[] of type class java.util.ArrayList into an instance of class java.lang.String</code></p>

<p>Also the implementation of the Post Class and the PostSummary Class is simple:</p>

<p><code>Post.java</code>:</p>

<pre><code>@Document
public class Post {
    @Id
    private String id;
    private String title;
    private List&lt;String&gt; upvotesBy;
    private String file;
    private String description;
    private String postedBy;
    private Date createdAt = new Date();

//  ... Getters and Setters for each field
}
</code></pre>

<p><code>PostSummary.java</code>:</p>

<pre><code>public class PostSummary {
    private String username;
    private String title;
    private String description;
    private List&lt;String&gt; upvotesBy;
    private String file;
    private String createdAt;
    private String id;

//... Getters and Setters for the class
}
</code></pre>

<p>I also need to implement the <code>isUpvoted</code> and <code>isPinned</code> part of the query, but getting the idea on how to approach the first problem would be a great start.</p>

<p>EDIT: My desired output:</p>

<pre><code>[
{
   "username" : "user1", 
   "title" : "postim2", 
   "upvotesBy" : [
      "5e18b4c12753608718dfa007", 
      "5e19ac0f5161a4994ded1f35"
   ],
   "file": "file1",
   id: "5e18b4c12753608718dber01"
   ... Other fields of the original post
},
{
   "username" : "user2", 
   "title" : "postim2", 
   "upvotesBy" : [
      "5e18b4c12753608718dfa007", 
      "5e19ac0f5161a4994ded1f35"
   ],
   id: "5e18b4c12753608718dber02",
   "file": "file2",
   ... Other fields of the original post
}
]
</code></pre>

<p>So from the lookup operation I need only to get the name of the user.</p>

