Embed Field: Put a prefix for ObjectID for MongoDB _id field<p>I'm trying to put a prefix before the auto generated <code>_id</code>, to identify from which collection came an id, but I still want to use the mongo unique id generator.</p>

<p>So I can know that this id <code>model_5e1a51821c9d44000089e3e0</code> came from the Model collection.</p>

<p>Is there a solution for that without messing with random string ?</p>

<p><strong>Edit</strong></p>

<p>The <code>_id</code> need to be string castable, since I use it as <code>id</code> in a graphQL object. I need to differentiate <strong>ids</strong> because I use an union in my schema and resolver need to know in which table to find the data.</p>; Answer: For an own login page you can do something like:

