Does MongoDB aggregation $project decrease the amount of data to be kept in memory?<p>I am wondering whether writing <code>$project</code> just after the <code>$match</code> statement is actually decrease the amount of data to be kept in memory. As an example if we want an array element with paging from a user document like following:</p>

<pre><code>const skip = 20;
const limit = 50;

UserModel.aggregate([
            { $match: { _id: userId } },
            { $project: { _id: 0, postList: 1 } },
            { $slice: ["$postList", skip, limit] },
            { $lookup: ...
]);
</code></pre>

<p>Assume that there are other lists in the user document and they are very large in size. </p>

<p>So, Is <code>$project</code> will help to improve the performance by not taking other large lists in memory?</p>

