Mongoose have same function for save and update middleware<p>So I have a question: how does one make middleware run on two different hooks?
I want to replace this code:</p>

<pre><code>userSchema.pre('save', function(next) {
  if (!this.localAuth.password) next();
  this.localAuth.password = this.generateHash(this.localAuth.password);
  next();
})
userSchema.pre('update', function(next) {
  if (!this.localAuth.password) next();
  this.localAuth.password = this.generateHash(this.localAuth.password);
  next();
})
</code></pre>

<p>With something like this:</p>

<pre><code>userSchema.pre('saveOrUpdate', function(next) {
  if (!this.localAuth.password) next();
  this.localAuth.password = this.generateHash(this.localAuth.password);
  next();
})
</code></pre>

<p>Notice how the functions are the same, I just need a hook that is runs on save and update. Any help is appreciated. Thanks!</p>

