      "field_2": "test"
    },
    "object2": {
      "field_1": "false",
      "field_2": "test"
    }
  }
}
</code></pre>

<p>I am trying to make a query that, for each document where <code>field1 = "A"</code>, returns only <code>field1</code> and the count of objects in <code>array1</code> where the boolean <code>field_1</code> is <code>true</code>. (There are many more fields and arrays in the document apart from those included here, so it is important that I only retrieve the specified field and array and not everything). So in this example, I would end up with the following:</p>

<pre><code>{
  "_id": "1",
